import React, { useState } from 'react';
import { useForm } from 'react-hook-form';
import TextField from '@mui/material/TextField';
import Button from '@mui/material/Button';
import MenuItem from '@mui/material/MenuItem';
import FormControl from '@mui/material/FormControl';
import InputLabel from '@mui/material/InputLabel';
import Select from '@mui/material/Select';
import { useLocation, useNavigate } from 'react-router-dom';
import Avatar from '@mui/material/Avatar';
import { useDispatch } from 'react-redux';
import { putProduct } from "../../features/Product/ProductSlice";
import Grid from '@mui/material/Grid'; // הוספתי את הייבוא של Grid

const defaultTheme = createTheme();

const UpdateProduct = () => {
    // const { state } = useLocation();
    // const product = state?.p;

    // const dispatch = useDispatch();
    // const navigate = useNavigate();


    const { register, handleSubmit, formState: { errors } } = useForm();
    const { state } = useLocation();
    let product = state.p;
    const [imageSrc, setImageSrc] = useState(product.id === 0 ? null : product.imgUrl);
    const [selectedFile, setSelectedFile] = useState(null);
    const dispatch = useDispatch();
    const  onSubmit= (data) => {
        const formData = new FormData();
        formData.append('product', JSON.stringify({
            name: data.name,
            description: data.description,
            price: data.price,
            imgUrl: data.imgUrl,
 
        }));
        formData.append('file', selectedFile);
        dispatch(putProduct({ id: product.id, updatedProduct: formData }));



        const handleFileChange = (event) => {
            setSelectedFile(event.target.files[0]);
            const reader = new FileReader();
            reader.onloadend = () => {
                setImageSrc(reader.result);
            };
            if (event.target.files[0]) {
                reader.readAsDataURL(event.target.files[0]);
            }
        };
        // console.log(newProduct);
        // dispatch(putProduct(newProduct));
        // navigate('/ProductList');
    };

    return (
        <form className="width" align="center" onSubmit={handleSubmit(onSubmit)}>
        <p align="center"><Avatar sx={{ width: 75, height: 75 }} src={imageSrc} /></p>
        <div className='grid1'>
            <TextField
                required
                error={!!errors.name}
                helperText={errors.name ? 'At least 2 characters' : ' '}
                label="Name"
                {...register("name", { required: true, minLength: 2 })}
                variant="standard"
                defaultValue={product.id !== 0 ? product.name : ""}
            />
            <TextField
                required
                error={!!errors.description}
                helperText={errors.description ? 'Required field' : ' '}
                label="Description"
                {...register("description", { required: true })}
                variant="standard"
                defaultValue={product.id !== 0 ? product.description : ""}
            />
            <FormControl variant="standard" error={!!errors.category}>
                <InputLabel>Category</InputLabel>
                <Select
                    label="Category"
                    {...register("category", { required: true })}
                >
                    {categories.map((category, index) => (
                        <MenuItem key={index} value={category}>{category}</MenuItem>
                    ))}
                </Select>
            </FormControl>
            <TextField
                required
                error={!!errors.price}
                helperText={errors.price ? 'Minimum price is 0' : ' '}
                label="Price"
                type="number"
                {...register("price", { required: true, min: 0 })}
                variant="standard"
                defaultValue={product.id !== 0 ? product.price : ""}
            />

            <TextField
                required
                error={!!errors.imgUrl}
                type="file"
                {...register("imgUrl", { required: true })}
                helperText={errors.imgUrl ? 'Required field' : ' '}
                variant="standard"
                onChange={handleFileChange}
            />
            <p className="red">* Required fields</p>
            <Button type="submit" variant="contained" color="primary">{product.id !== 0 ? "UPDATE" : "ADD"}</Button>
        </div>
    </form>
    );
};

export default UpdateProduct;
